<?php

// https://leetcode.com/problems/is-subsequence/submissions/

class Solution
{

    /**
     * @param String $s
     * @param String $t
     * @return Boolean
     */
    function isSubsequence($s, $t)
    {
        $matched = [];
        $index = 0;
        for ($i = 0; $i <= strlen($s) - 1; $i++) {

            for ($j = $index; $j < strlen($t); $j++) {
                if ($s[$i] == $t[$j]) {
                    $matched[$j] = $t[$j];
                    $index = $j + 1;
                    break;
                }
            }
        }

        ksort($matched);
        $matchedString = implode('', $matched);

        if ($s === $matchedString)
            return true;
        return false;
    }
}

$sol = new Solution();
$sol->isSubsequence("ab", "baab");

